-- 判断执行环境
local agg = gg["adb"]
local have_agg = agg ~= nil
local gg_cmd = gg["command"]
local have_gg = gg_cmd ~= nil
local run_command = have_agg and function(cmd, ...)
    return agg(cmd, ...)
end or have_gg and function(cmd, ...)
    return gg_cmd(cmd, ...)
end or function(...)
    gg.alert(lang_text[current_lang].environment_error)
end

-- 环境检测函数
local function CheckEnvironment()
    if not have_agg and not have_gg then
        gg.alert(lang_text[current_lang].important_notice)
        TC()
    end
end
local modules = gg.getRangesList("^/data/*.so*$")

local function getDifferentSymbols()
    local idx1 = math.random(1, #Arrays)
    local idx2 = idx1
    while idx2 == idx1 do
        idx2 = math.random(1, #Arrays)
    end
    return Arrays[idx1], Arrays[idx2]
end

-- 获取随机名言
local function getRandomQuote()
    local quotes = lang_text[current_lang].ch_arrays
    return quotes[math.random(1, #quotes)]
end

