    local SS = symbolSS
    local Ch = getRandomQuote() -- 使用当前语言的随机名言
    local pkg = gg.getTargetInfo().cmdLine or "none"
    local packageName = gg.getTargetInfo().label or "none"

    local menu_options = {
        S .. "1." .. lang_text[current_lang].menu.base_search .. S_END,
        S .. "2." .. lang_text[current_lang].menu.output_text .. S_END,
        S .. "3." .. lang_text[current_lang].menu.format_compare .. S_END,
        S .. "4." .. lang_text[current_lang].menu.install_program .. S_END,
        S .. "5." .. lang_text[current_lang].menu.specify_module .. S_END,
        S .. "6." .. lang_text[current_lang].menu.exit_script .. S_END,
        S .. "7." .. lang_text[current_lang].language.switch_language .. S_END,
      --  S .. "8.? Help / 帮助 / Помощь" .. S_END
    }

    local prompt_msg =
        table.concat(
            {
                SS .. SS .. SS .. lang_text[current_lang].prompt.future,
                SS .. Ch,
                SS .. " " .. lang_text[current_lang].prompt.current_app .. packageName,
                SS .. " " .. lang_text[current_lang].prompt.exec_env .. "[" .. pkg .. "]" .. 
                    (have_agg and "AGG" or have_gg and "GG" or lang_text[current_lang].unknown_env),
                SS .. " " .. lang_text[current_lang].prompt.module_filter .. 
                    string.format("%s", #local_modules > 0 and #local_modules or lang_text[current_lang].all_modules) .. " " ..  languages[current_lang] ..  " " .. SCRIPT_VERSION
                
            },
            "\n"
        )

    local SN = gg.choice(menu_options, nil, prompt_msg)

    if SN == 1 then
        SM()
    elseif SN == 2 then
        GS()
    elseif SN == 3 then
        DB()
    elseif SN == 4 then
        AZ()
    elseif SN == 5 then
        local_modules = MK()
    elseif SN == 6 then
        TC()
    elseif SN == 7 then
        -- 切换语言
        current_lang = SelectLanguage()
        SaveLanguageSettings() -- 保存语言设置
        gg.toast(lang_text[current_lang].language.language_setting_saved)
    elseif SN == 8 then
        -- 显示帮助
        ShowHelp()
    end
end

-- 定义函数：获取下一个可用的文件名
local function get_next_available_file(path)
    local function file_exists(file_path)
        local file = io.open(file_path, "r")
        if file then
            file:close()
            return true
        end
        return false
    end

    local files = {}
    for i = 1, 1000 do
        local file_name = string.format(lang_text[current_lang].install.output_file_pattern, i)
        local file_path = path .. "/" .. file_name
        if file_exists(file_path) then
            table.insert(files, file_name)
        else
            break
        end
    end

    local max_number = 0
    for _, file_name in pairs(files) do
        local number = file_name:match("out%[(%d+)%].bin")
        if number then
            max_number = math.max(max_number, tonumber(number))
        end
    end

    return max_number == 0 and string.format(lang_text[current_lang].install.output_file_pattern, 1) or 
           string.format(lang_text[current_lang].install.output_file_pattern, max_number + 1)
end

local function file_exists(file_path)
    local file = io.open(file_path, "r")
    if file then
        file:close()
        return true
    end
    return false
end

local selected_indices = {}
function MK()
    -- 检查模块
    local modules_data = modules or {}
    if #modules_data == 0 then
        gg.alert(lang_text[current_lang].module.not_found)
        return local_modules
    end
    local module_list = {}
    local module_info = {}
    local unique_mods = {}
    local selected_modules = {}

    for _, mod in pairs(modules_data) do
        if mod.internalName then
            local full_name = mod.internalName:match("/([^/]+)$") or mod.internalName
            local base_name = full_name:match("^(.+%.so)(:bss)?$")
            if not base_name then
                base_name = full_name
            end

            if not unique_mods[base_name] then
                unique_mods[base_name] = true
                local start_addr = mod.start and string.format("[%08X]", mod.start) or "[地址未知]"
                local item = string.format("%s", base_name)
                table.insert(
                    module_info,
                    {
                        display_name = item,
                        name = base_name,
                        path = mod.internalName,
                        start = mod.start
                    }
                )
            end
        end
    end

    for index, mod in pairs(module_info) do
        table.insert(module_list, string.format("%s", index .. "." .. mod.display_name))
    end

    selected_indices = gg.multiChoice(module_list, selected_indices, lang_text[current_lang].module.select_prompt)
    if not selected_indices then
        gg.alert(lang_text[current_lang].module.operation_canceled)
        return local_modules
    end

    for index, idx in pairs(selected_indices) do
        if idx then
            local mod = module_info[index]
            table.insert(selected_modules, mod)
        end
    end

    local result = { string.format(lang_text[current_lang].module.selected_modules, #selected_modules) }
    for i, mod in pairs(selected_modules) do
        table.insert(
            result,
            string.format(
                "%d. %s\n   %s: %s\n   %s: %s",
                i,
                mod.name,
                lang_text[current_lang].module.path, mod.path,
                lang_text[current_lang].module.address, 
                mod.start and string.format("%08X", mod.start) or lang_text[current_lang].module.unknown
            )
        )
    end

    gg.alert(table.concat(result, "\n\n"))
    return selected_modules
end

function GS()
    if not file_exists(bin_save_path) then
        gg.alert(lang_text[current_lang].output.install_first)
        return
    end

    local cfg_file = gg.EXT_FILES_DIR .. "/" .. gg.getFile():match("[^/]+$") .. "output.cfg"
    local cfg = loadfile(cfg_file) and loadfile(cfg_file)() or {}
    local pkg = gg.getTargetPackage() or "none"

    local def = cfg[pkg] or { save, save, "" } -- 文件1、文件2、输出文件

    -- 自定义提示
    local prompt_msg = lang_text[current_lang].output.default_output_path
    local file1 = def[1]

    local out_dir = file1:match("^(.*)/") or save
    local count = 1
    while true do
        local default_out_path = string.format(lang_text[current_lang].install.format_file_pattern, out_dir, count)
        if not file_exists(default_out_path) then
            def[2] = default_out_path
            break
        end
        count = count + 1
    end

    local compare =
        gg.prompt(
            { lang_text[current_lang].output.format_file, lang_text[current_lang].output.output_file },
            def,
            { "file", "file" },
            { desc1 = lang_text[current_lang].output.select_first_file, desc3 = string.format(prompt_msg, out_dir, count) }
        )

    if not compare or #compare < 2 then
        return
    end

    -- 检查文件存在
    local file1Exists = file_exists(compare[1])
    if not file1Exists  then
        gg.alert(lang_text[current_lang].output.error .. "\n" .. (not file1Exists and lang_text[current_lang].output.file1_not_exist or ""))
        return
    end

    cfg[pkg] = compare
    gg.saveVariable(cfg, cfg_file)

    local bit = gg.getTargetInfo().x64 or false
    local bit_str = bit and "64" or "32"
    local cmd =
        string.format(
            "%s --flag output --bit %s --format %s --out %s",
            bin_save_path,
            bit_str,
            compare[1],
            compare[2]
        )

    gg.alert(lang_text[current_lang].output.click_confirm)
    local result = run_command(cmd, true)

    local display_result = ""
    if type(result) == "table" and result.s then
        display_result = table.concat(result.s, "\n")
    elseif type(result) == "string" then
        display_result = result
    end

    gg.alert((display_result ~= "" and display_result or lang_text[current_lang].output.no_result))
end


-- 基址搜索函数
function SM()
    if not file_exists(bin_save_path) then
        gg.alert(lang_text[current_lang].search.install_first)
        return
    end
    if gg.getResultsCount() ~= 1 then
        gg.alert(lang_text[current_lang].search.empty_search)
        return
    end

    local addr = string.format("0x%X", gg.getResults(1)[1].address)
    local cfg_file = gg.EXT_FILES_DIR .. "/" .. gg.getFile():match("[^/]+$") .. "point.cfg"
    local cfg = loadfile(cfg_file) and loadfile(cfg_file)() or {}
    local pkg = gg.getTargetPackage() or "none"
    local file_path = save .. get_next_available_file(save)
    local def = cfg[pkg] or { "0xFFFFFF", "4", "2000", file_path }

    local modules_list = {}
    for _, value in pairs(local_modules) do
        table.insert(modules_list, value.display_name)
    end
    local libs = table.concat(modules_list, ",")

    def[1], def[4], def[5] = addr, libs, file_path
    local scan = gg.prompt({ 
        lang_text[current_lang].search.search_address, 
        lang_text[current_lang].search.scan_level, 
        lang_text[current_lang].search.search_range, 
        lang_text[current_lang].search.limit_module, 
        lang_text[current_lang].search.output_file 
    }, def, { "txt", "txt", "txt", "", "file" }, def)
    
    if not scan or #scan ~= 5 then
        return
    end

    local only_lib = ""
    if def[4] ~= "" then
        only_lib = "--lib=" .. scan[4]
    end
    cfg[pkg] = scan
    gg.saveVariable(cfg, cfg_file)

    local bit = gg.getTargetInfo().x64 or false
    local bit_str = bit and "64" or "32"
    local cmd =
        string.format(
            "%s --pid %d --flag search --bit %s --pointers %s --level %s --offset %s %s --out %s",
            bin_save_path,
            gg.getTargetInfo().pid or 0,
            bit_str,
            scan[1],
            scan[2],
            scan[3],
            only_lib,
            scan[5]
        )

    gg.alert(lang_text[current_lang].search.click_confirm)
    local result = run_command(cmd, true)

    local display_result = ""
    if type(result) == "table" and result.s then
        display_result = table.concat(result.s, "\n")
    elseif type(result) == "string" then
        display_result = result
    end

    gg.alert((display_result ~= "" and display_result or lang_text[current_lang].search.no_result))
end

-- 格式对比函数
function DB()
    if not file_exists(bin_save_path) then
        gg.alert(lang_text[current_lang].compare.install_first)
        return
    end

    local cfg_file = gg.EXT_FILES_DIR .. "/" .. gg.getFile():match("[^/]+$") .. "compare.cfg"
    local cfg = loadfile(cfg_file) and loadfile(cfg_file)() or {}
    local pkg = gg.getTargetPackage() or "none"

    local def = cfg[pkg] or { save, save, "" } -- 文件1、文件2、输出文件

    -- 自定义提示
    local prompt_msg = lang_text[current_lang].compare.default_output_path
    local file1 = def[1]

    local out_dir = file1:match("^(.*)/") or save
    local count = 1
    while true do
        local default_out_path = string.format(lang_text[current_lang].install.compare_file_pattern, out_dir, count)
        if not file_exists(default_out_path) then
            def[3] = default_out_path
            break
        end
        count = count + 1
    end

    local compare =
        gg.prompt(
            { 
                lang_text[current_lang].compare.scan_file1, 
                lang_text[current_lang].compare.scan_file2, 
                lang_text[current_lang].compare.output_file 
            },
            def,
            { "file", "file", "file" },
            { 
                desc1 = lang_text[current_lang].compare.select_first_file, 
                desc2 = lang_text[current_lang].compare.select_second_file, 
                desc3 = string.format(prompt_msg, out_dir, count) 
            }
        )

    if not compare or #compare < 3 then
        return
    end

    -- 检查文件存在
    local file1Exists = file_exists(compare[1])
    local file2Exists = file_exists(compare[2])
    if not file1Exists or not file2Exists then
        gg.alert(lang_text[current_lang].compare.error .. "\n" .. 
                (not file1Exists and lang_text[current_lang].compare.file1_not_exist or "") .. 
                (not file2Exists and lang_text[current_lang].compare.file2_not_exist or ""))
        return
    end

    cfg[pkg] = compare
    gg.saveVariable(cfg, cfg_file)

    local bit = gg.getTargetInfo().x64 or false
    local bit_str = bit and "64" or "32"
    local cmd =
        string.format(
            "%s --flag compare --bit %s --compare %s,%s --out %s",
            bin_save_path,
            bit_str,
            compare[1],
            compare[2],
            compare[3]
        )

    gg.alert(lang_text[current_lang].compare.click_confirm)
    local result = run_command(cmd, true)

    local display_result = ""
    if type(result) == "table" and result.s then
        display_result = table.concat(result.s, "\n")
    elseif type(result) == "string" then
        display_result = result
    end

    gg.alert((display_result ~= "" and display_result or lang_text[current_lang].compare.no_result))
end

