    local pre_start = os.clock()
    local function hex_to_binary(hex_str)
        return hex_str:gsub("%s+", ""):gsub(
            "..",
            function(hex)
                return string.char(tonumber(hex, 16) or 0)
            end
        )
    end
    local arm_data = hex_to_binary(aarch64_bin or "")
    local x64_data = hex_to_binary(x64_bin or "")
    local pre_time = os.clock() - pre_start

    local choice = gg.choice({ 
        lang_text[current_lang].install.arm64, 
        lang_text[current_lang].install.x64, 
        lang_text[current_lang].install.delete_program 
    }, nil, lang_text[current_lang].install.install_mode)
    
    if not choice or choice < 1 or choice > 3 then
        return
    end

    if choice == 3 then
        -- 确认删除
        local confirm = gg.choice({
            lang_text[current_lang].install.yes,
            lang_text[current_lang].install.no
        }, nil, lang_text[current_lang].install.confirm_delete)
        
        if not confirm or confirm ~= 1 then
            return
        end
    
        gg.toast(lang_text[current_lang].install.processing)
        
        local path = bin_save_path

        local check_start = os.clock()
        local file = io.open(path, "r")
        local exists = (file ~= nil)
        if file then
            file:close()
        end
        local check_time = os.clock() - check_start

        if not exists then
            gg.alert(string.format([[
%s
%s%s
%s
%s]], 
                lang_text[current_lang].install.check_result,
                lang_text[current_lang].install.path, path,
                lang_text[current_lang].install.file_not_exist,
                string.format(lang_text[current_lang].install.check_time, check_time)))
            return
        end

        local del_start = os.clock()
        local success = os.remove(path)
        local del_time = os.clock() - del_start

        if success then
            gg.alert(
                string.format(
                    [[
%s
%s%s
%s
%s
%s
]],
                    lang_text[current_lang].install.delete_success,
                    lang_text[current_lang].install.path, path,
                    string.format(lang_text[current_lang].install.verification_time, check_time),
                    string.format(lang_text[current_lang].install.delete_time, del_time),
                    string.format(lang_text[current_lang].install.total_operation_time, check_time + del_time)
                )
            )
            gg.toast(lang_text[current_lang].install.successful_operation)
        else
            gg.alert(
                string.format([[
%s
%s%s
%s
%s
%s]], 
                    lang_text[current_lang].install.delete_failed,
                    lang_text[current_lang].install.path, path,
                    string.format(lang_text[current_lang].install.verification_time, check_time),
                    string.format(lang_text[current_lang].install.delete_time, del_time),
                    lang_text[current_lang].install.error_permission)
            )
        end
        return
    end

    -- 确认安装
    local confirm = gg.choice({
        lang_text[current_lang].install.yes,
        lang_text[current_lang].install.no
    }, nil, lang_text[current_lang].install.confirm_install)
    
    if not confirm or confirm ~= 1 then
        return
    end

    gg.toast(lang_text[current_lang].install.processing)
    
    local script_start = os.clock()
    local stage_time = { write = 0, chmod = 0, total = 0 }

    local file = io.open(bin_save_path, "wb")
    if not file then
        gg.alert(string.format(lang_text[current_lang].install.file_creation_failed, bin_save_path))
        return
    end
    file:write(choice == 1 and arm_data or x64_data)
    file:close()
    stage_time.write = os.clock() - script_start

    local file_path = bin_save_path:gsub('"', '\\"')
    local chmod_cmd = string.format("chmod 777 %s", file_path)
    local success, err = run_command(chmod_cmd, true)
    stage_time.chmod = os.clock() - script_start - stage_time.write
    stage_time.total = os.clock() - script_start

    local total_time = pre_time + stage_time.total
    if success then
        gg.alert(
            string.format(
                [[
%s
%s
%s
%s
%s
]],
                string.format(lang_text[current_lang].install.install_success, total_time),
                string.format(lang_text[current_lang].install.install_path, bin_save_path),
                string.format(lang_text[current_lang].install.data_preprocessing, pre_time),
                string.format(lang_text[current_lang].install.file_writing, stage_time.write),
                string.format(lang_text[current_lang].install.permission_setting, stage_time.chmod)
            )
        )
        gg.toast(lang_text[current_lang].install.successful_operation)
    else
        gg.alert(
            string.format(
                [[
%s
%s
%s
%s
]],
                string.format(lang_text[current_lang].install.permission_failure, total_time),
                string.format(lang_text[current_lang].install.error, err or lang_text[current_lang].install.unknown_error),
                string.format(lang_text[current_lang].install.data_preprocessing, pre_time),
                string.format(lang_text[current_lang].install.file_writing, stage_time.write)
            )
        )
    end
end

function TC() -- 退出函数
    gg.alert(string.format(lang_text[current_lang].exit.script_end, os.date("%Y-%m-%d %H:%M:%S"))
             .. "\n\n" .. lang_text[current_lang].script_info.copyright)
    os.exit()
end

-- 显示帮助信息
local function ShowHelp()
    local help_msg = string.format("%s\n\n%s\n\n%s\n\n%s\n%s",
        lang_text[current_lang].help.title,
        lang_text[current_lang].help.language_switch,
        lang_text[current_lang].help.multi_language_support,
        string.format(lang_text[current_lang].script_info.version, SCRIPT_VERSION),
        lang_text[current_lang].script_info.author
    )
    gg.alert(help_msg)
end

-- 初始化语言选择
local function Initialize()
    -- 先尝试加载保存的语言设置
    current_lang = LoadLanguageSettings()
    
    -- 如果是第一次运行或用户要求选择语言，则显示语言选择对话框
    local firstRun = gg.isVisible() -- 如果可见，则认为是第一次运行
    if firstRun then
        local old_lang = current_lang
        current_lang = SelectLanguage()
        
        -- 如果语言改变了，保存设置
        if old_lang ~= current_lang then
            SaveLanguageSettings()
            gg.toast(lang_text[current_lang].language.language_setting_saved)
        end
    end
    
    -- 显示当前语言
    gg.toast(languages[current_lang])
end

-- 脚本入口
Initialize()
gg.showUiButton()
while true do
    if gg.isClickedUiButton() then
        Main()
    end
end
